import web3 from "./web3";
import PropertyFactory from "./build/PropertyFactory.json";

const instance = new web3.eth.Contract(
    PropertyFactory.abi,
   "0x71E36B1A1352382195E2e08EaF44053D7d0d94a4"
  );

  export default instance;
